class Solution:
    def lengthAfterTransformations(self, s: str, t: int) -> int:
        mod = 10**9 + 7
        cnt = [0] * 26
        for ch in s:
            cnt[ord(ch) - ord("a")] += 1
        for round in range(t):
            nxt = [0] * 26
            nxt[0] = cnt[25]
            nxt[1] = (cnt[25] + cnt[0]) % mod
            for i in range(2, 26):
                nxt[i] = cnt[i - 1]
            cnt = nxt
        ans = sum(cnt) % mod
        return ans

# Main section
for s, t in [
               ('abcyy', 2),
               ('azbk', 1),
               ('', 100000),
            ]:
    print(f's, t = {s}, {t}')
    sol = Solution()
    r = sol.lengthAfterTransformations(s, t)
    print(f'r = {r}')
    print('============================')


